window.bookSummaryJSON = "<p>Otto Shenk is the youngest son of a minor baron. He's also a wizard.</p> <p>Abused by his family and considered less than human by his kingdom, Otto does his best to survive. But everything changes when Otto stumbles across a tower hidden deep in a dark part of the forest near his home.</p> <p>A tower that was once the home of an Arcane Lord, the immortal wizards that long ago ruled the world. Otto’s life will be changed forever. And so will the world.</p>"; 
